import React from 'react';
import './App.css';
import {useForm} from './form.js';

function App() {

  const[value,handleChange]=useForm({
    name:"",
    email:""
  })
  console.log(value.name)
  console.log(value.email)

  return (
   <>
   <input type="text" name="a" defaultValue={value.email} onChange={handleChange}/>
   <input type="text" name="b" defaultValue={value.name} onChange={handleChange} />
   </>
  );
}

export default App;
